import "./Responsive.scss";
import "./Login.scss";

import { Col, Row, Button, Checkbox, Form, Input } from "antd";
import { LoginOutlined } from "@ant-design/icons";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";
import HomePage from "../homePage/HomePage";
import { SetStateAction, useState } from "react";

Login.propTypes = {};

function Login() {
  const onFinish = (values: any) => {
    console.log("Success:", values);
  };

  const onFinishFailed = (errorInfo: any) => {
    console.log("Failed:", errorInfo);
  };

  const [username, setUserName] = useState("");
  const [password, setPassword] = useState("");
  const [login, setLogin] = useState(localStorage.getItem("accessToken") != null)
  const setParams = (event: { target: { name: string; value: SetStateAction<string>; }; }) => {
    if (event.target.name === "username") {
      setUserName(event.target.value);
    }
    if (event.target.name === "password") {
      setUserName(event.target.value);
    }
  };

  const isLogin = () => {
    const myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/x-www-form-urlencoded");

    const urlencoded = new URLSearchParams();
    urlencoded.append("username", username);
    urlencoded.append("password", password);

    const requestOptions = {
      method: 'POST',
      headers: myHeaders,
      body: urlencoded,
      redirect: 'follow'
    }

    fetch("http://192.168.2.224:9099/api/auth/signin", requestOptions)
      .then(response => {
        console.log(response)
        if(response.ok){
          return response.json()
        }

        throw new Error(response.status)
      })
      .then(result => {
        console.log(result)
        localStorage.setItem("accessToken", result.accessToken)
      })
      .catch
  }

  return (
    <div className="App">
      <Row style={{ height: "100%" }}>
        <Col span={12} xs={24} sm={12}>
          <div className="register register-left">
            <div className="title">
              <img
                src="https://cdn.haitrieu.com/wp-content/uploads/2022/06/Logo-Thanh-Pho-Da-Nang.png"
                alt="logo DA NANG city"
              />
              <h2>KHO KẾT QUẢ THỦ TỤC HÀNH CHÍNH SỐ</h2>
            </div>

            <Form
              name="basic"
              labelCol={{ span: 24 }}
              wrapperCol={{ span: 0 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              autoComplete="off"
            >
              <Form.Item
                label="Tên đăng nhập"
                name="username"
                rules={[
                  { required: true, message: "Vui lòng nhập tên đăng nhập!" },
                ]}
              >
                <Input onChange={setParams} />
              </Form.Item>

              <Form.Item
                label="Mật khẩu"
                name="password"
                rules={[{ required: true, message: "Vui lòng nhập mật khẩu!" }]}
              >
                <Input.Password onChange={setParams} />
              </Form.Item>

              <Form.Item
                name="remember"
                valuePropName="checked"
                wrapperCol={{ offset: 0, span: 11 }}
              >
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Link to="/HomePage">
                <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                  <Button
                    type="primary"
                    htmlType="submit"
                    style={{ width: "100%" }}
                    onClick={Login}
                  >
                    <LoginOutlined />
                    Đăng nhập
                  </Button>
                </Form.Item>
              </Link>
              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  htmlType="submit"
                  style={{
                    width: "100%",
                    backgroundColor: "#ff8f18",
                  }}
                  type="primary"
                >
                  Đăng nhập bằng tài khoản công dân số
                </Button>
              </Form.Item>
            </Form>
          </div>
        </Col>
        <Col span={12} xs={24} sm={12} className="col-right">
          <div className="register register-right"></div>
        </Col>
      </Row>
    </div>
  );
}

export default Login;
